/** @format */

import React from "react";
import { ComponentStory, ComponentMeta } from "@storybook/react";
import "rsuite/dist/rsuite.min.css";
import { Button } from ".";
import { Button as Component } from "rsuite";

export default {
    title: "Components/Button",
    component: Button,
    subcomponents: { Component },
    argTypes: {
        children: {},
        type
    }
}
